import React , {Component} from 'react';
import "./items.css"
import App from './App';
class Items extends Component{
    render()
    {
        const {items} = this.props;
        const theItems  = items.map(item=>{
 
      <div className='item' key ={item.id}>
    <div>{item.id}</div>
    <div>{item.age}</div>
    <div>{item.name}</div>
        </div>
   
      
     
   
      
    
 
        })
        return(
            <div>
   {theItems}
</div>
        );
    }
}
export default Items;
